import { View, Text } from "react-native";
import React, { useContext } from "react";
import { ScrapeContext } from "./ScrapeContext";
export default function Data() {
  const { scrapes } = useContext(ScrapeContext);
  console.log(scrapes);
  return (
    <View>
      <Text>Confirmed: {scrapes.worldwide.confirmed + "\n"}</Text>
      <Text>Recovered: {scrapes.worldwide.deaths + "\n"}</Text>
      <Text>Deaths: {scrapes.worldwide.recovered + "\n"}</Text>
    </View>
  );
}
